import React from "react";
import Heading from "../common/heading/Heading";
import "./about.css";
import { homeAbout } from "../../dummydata";
import Awrapper from "./Awrapper";

const AboutCard = () => {
  return (
    <>
      <section className="aboutHome">
        <div className="container flexSB">
          <div className="left row">
            <img src="./images/benifit2.jpg" alt="Agriculture Benefits" />
          </div>
          <div className="right row">
            <Heading subtitle="FarmEco" title="Benefits About Agri Waste Recycling" />

            {/* Static Content Section */}
            <div className="about-details">
              <Heading subtitle="About Jai Kisan Agro" />
              <p>
                Jai Kisan Agro is a forward-thinking agricultural company dedicated to transforming waste into health. Through
                innovative agricultural waste recycling techniques, we are helping to reduce environmental impact while
                contributing to the sustainable growth of the farming industry.
              </p>

              <Heading subtitle="Our Mission" />
              <p>
                To reduce the harmful environmental impact of agricultural waste and promote a circular economy within the
                farming sector. By recycling and reusing agricultural waste, we create valuable resources that enhance soil
                health, improve crop yields, and reduce dependence on chemical fertilizers.
              </p>

              <Heading subtitle="Our Vision" />
              <p>
                We envision a world where farmers have access to sustainable and eco-friendly solutions that improve crop health,
                increase productivity, and reduce waste. By leveraging cutting-edge technology, Jai Kisan Agro aims to be at the
                forefront of agricultural innovation.
              </p>

              <Heading subtitle="What We Do" />
              <ul>
                <li>Agri Waste Recycling: Turning agricultural waste into valuable resources like compost, fertilizers, and biogas.</li>
                <li>Soil Health Improvement: Helping farmers restore soil health through organic solutions.</li>
                <li>Eco-Friendly Solutions: Offering biodegradable packaging and renewable energy solutions.</li>
                <li>Farmer Empowerment: Providing tools, knowledge, and support for sustainable farming practices.</li>
              </ul>

              <Heading subtitle="Our Values" />
              <ul>
                <li>Sustainability: Transforming waste into resources and promoting a circular economy.</li>
                <li>Innovation: Constantly exploring new technologies and techniques.</li>
                <li>Empathy: Solutions designed to improve farmers' efficiency and profitability.</li>
              </ul>

              <Heading subtitle="Why Choose Us?" />
              <ul>
                <li>Environmentally Friendly: Solutions designed to reduce waste and pollution.</li>
                <li>Support for Farmers: Cost-effective, sustainable alternatives to traditional farming inputs.</li>
                <li>Quality Products: Ensuring products meet high standards of quality and safety.</li>
              </ul>
            </div>

            {/* Dynamic Content Rendering */}
            <div className="items">
              {homeAbout.map((val, index) => (
                <div className="item flexSB" key={index}>
                  <div className="img">
                    <img src={val.cover} alt={val.title} />
                  </div>
                  <div className="text">
                    <h2>{val.title}</h2>
                    <p>{val.desc}</p>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </section>
      <Awrapper />
    </>
  );
};

export default AboutCard;
